import styled from "styled-components";

export default function Login(){
    return(
        <Container>
            <h1>My Wallet</h1>
            <form action="">
                <input type="email" />
                <input type="password" />
                <button type="submit"></button>
            </form>
            <h3>Primeira vez? cadastre-se!</h3>
        </Container>
    );
}

const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    width: 100%;
    height:915px;
    background-color: #8C11BE;

    h1{
        font-size: 32px;
        color: #FFFFFF;
        margin-bottom: 24px;
    }

    form{
        display: flex;
        justify-content: space-around;
        align-items: center;
        flex-direction: column;
        width: 326px;
        height: 200px;

        <input type="text" />
    }
`
